import '../top/HeadBar.css';
import logo from '../img/Logo.png';
import { Col, Row, Container} from "react-bootstrap";


function HeadBar() {
  return (
        <div className="bg">
          <Container className="container"> 
              <Row>
                <Col sm={4} className="logoBrand">
                  <img src={logo} alt="logo"></img>
                  <p>NKDLNalkdnl NDLNDLKSDNlkd</p>
                </Col>
                <Col sm={8}>
                <img src={logo} alt="logo"></img>
                  <p>NKDLNalkdnl NDLNDLKSDNlkd</p>
                </Col>
              </Row>
              <Row>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
    <Col sm>sm=true</Col>
  </Row>
          </Container>     
        </div>
          
  );
}

export default HeadBar;
